import React from "react";
import { NavLink } from "react-router-dom";
import img from "../slike/logo.png";

const Navbar = () => {
  return (
    <div className="h-screen w-[250px] bg-yellow text-black">
      <div className="h-[20%] flex justify-center items-center">
        <img src={img} className="mt-12 shadow-xl" />
      </div>
      <div className="h-[80%]">
        <li className="block flex justify-center  text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/leagues">LEAGUES</NavLink>
        </li>
        <li className="block flex justify-center mt-2 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/teams">TEAMS</NavLink>
        </li>
        <li className="block flex justify-center mt-2 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/transfers">TRANSFERS</NavLink>
        </li>
        <li className="block flex justify-center mt-2 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/livegames">LIVE GAMES</NavLink>
        </li>{" "}
      </div>
    </div>
  );
};

export default Navbar;
